import React, { useState } from 'react';

function App() {
  const [response, setResponse] = useState('');
  const [loading, setLoading] = useState(false);

  const testBackend = async () => {
    setLoading(true);
    try {
      const res = await fetch('http://localhost:5001/api/health');
      const data = await res.json();
      setResponse(JSON.stringify(data, null, 2));
    } catch (error) {
      setResponse('Error: ' + error.message);
    }
    setLoading(false);
  };

  const testAuth = async () => {
    setLoading(true);
    try {
      const res = await fetch('http://localhost:5001/api/auth/user');
      const data = await res.json();
      setResponse(JSON.stringify(data, null, 2));
    } catch (error) {
      setResponse('Error: ' + error.message);
    }
    setLoading(false);
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold text-center mb-8 text-gray-800">
          Study Buddy Matcher
        </h1>

        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-2xl font-semibold mb-4">Frontend Status</h2>
          <p className="text-green-600 font-medium">✅ React frontend is running!</p>
          <p className="text-gray-600">Port: 3000</p>
          <p className="text-gray-600">API URL: http://localhost:5001/api</p>
        </div>

        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-2xl font-semibold mb-4">Test Backend Connection</h2>
          <div className="flex gap-4 mb-4">
            <button
              onClick={testBackend}
              disabled={loading}
              className="bg-blue-500 text-white px-6 py-2 rounded hover:bg-blue-600 disabled:opacity-50"
            >
              {loading ? 'Testing...' : 'Test Health Check'}
            </button>

            <button
              onClick={testAuth}
              disabled={loading}
              className="bg-green-500 text-white px-6 py-2 rounded hover:bg-green-600 disabled:opacity-50"
            >
              {loading ? 'Testing...' : 'Test Auth Endpoint'}
            </button>
          </div>

          {response && (
            <div className="bg-gray-100 p-4 rounded border">
              <h3 className="font-semibold mb-2">Response:</h3>
              <pre className="text-sm overflow-auto">{response}</pre>
            </div>
          )}
        </div>

        <div className="bg-white rounded-lg shadow-md p-6">
          <h2 className="text-2xl font-semibold mb-4">Current Project Status</h2>
          <div className="space-y-2">
            <p className="text-green-600">✅ Backend running on port 5001</p>
            <p className="text-green-600">✅ Frontend running on port 3000</p>
            <p className="text-green-600">✅ MongoDB connected</p>
            <p className="text-yellow-600">⏳ Auth0 setup pending</p>
            <p className="text-yellow-600">⏳ Full UI components pending</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
